import Head from "next/head";
import Link from "next/link";
import Layout from "../app_components/layout/layout";
import {
  ContentLayout,
  MainBarLayout,
  SideBarLayout,
} from "../app_components/layout/content-layout";

import {NavBar} from '../app_components/NavBar';
import { NavBarLayout } from "../app_components/layout/navBar-layout";
import {Footer} from '../app_components/layout/footer-layout';

export default function Home() {
  return (
    <Layout>
      <Head>
        <title>Tech-Inventory</title>    
        <link
  rel="stylesheet"
  href="/bootstrap/dist/css/bootstrap.css"
/>
<script src='/jquery/dist/jquery.js'></script>
<script src='/popper.js/dist/popper.js'></script>
<script src="/bootstrap/dist/js/bootstrap.js"></script>
      </Head>
      <NavBarLayout><NavBar /></NavBarLayout>
      <ContentLayout>
        <MainBarLayout>main bar</MainBarLayout>
        <SideBarLayout>Side Bar</SideBarLayout>
      </ContentLayout>
      <Footer>
         Footer
      </Footer>
    </Layout>
  );
}
